import React from "react";


function Welcome() {
  return (
    <div className="base-container">
      <div className="content">
        <div className="form">
          <div className="header">Welcome</div>
          <button onClick={handleOnClick} type="button" className="btn">
              Logout
          </button>
    
        </div>
    

      </div>

    </div>
  );

}

export default Welcome;
